  {id:3,note:'Welocme in ourSchool'},
  {id:4,note:'Welocme in ourSchool'}
]
export default function Home() {
  return (
    <View style={{flexDirection:'row',flexWrap:'wrap',justifyContent:'space-evenly',}}>
      {Data.map((item)=>
        <View style={{width:'40%',height:120,backgroundColor:'white',
        borderRadius:10,elevation:4,margin:10,alignItems:'center',justifyContent:'center'}}>
          <Text style={{}}>{item.note}</Text>
              </View>
      )}
  


    </View>
  )
}
